query ArtistDetails($id: ID!) {
  artist(id: $id) {
    __typename
    ...ArtistInfo
    groups {
      __typename
      id
      displayName
      secondaryDisplayName
      images {
        __typename
        cardFlat
      }
    }
    members {
      __typename
      id
      displayName
      images {
        __typename
        icon
      }
    }
  }
}
